import { createMuiTheme } from "@material-ui/core/styles";

const fixWhite = "#F5F5F5";
const fixOrange = "#FF7F50";

export default createMuiTheme({
  palette: {
    common: {
      fixBlue: `${fixBlue}`,
      fixOrange: `${fixOrange}`,
    },
    primary: {
      main: `${fixBlue}`,
    },
    secondary: {
      main: `${fixOrange}`,
    },
  },
  typography: {
    h3: {
      fontWeight: 300,
    },
  },
});
